import React from 'react';
import LogoImg from '../img/logo.svg'
import NikeImg from '../img/nike.png'

const Card = () => {
  const colors = [
    {value: '#b6a179'},
    {value: '#272425'},
    {value: '#6389cb'},
    {value: '#f2c758'},
    {value: '#ffffff'},
  ];

  return <div>

   {/* Card */}
   <div className='w-[426px] min-h-[600px] bg-[#ffffffdd] rounded-[30px] border-[4px] border-white px-[40px] py-[24px]'>


   {/* Card logo */}
   <div className='mb-6'>
    <img src={LogoImg} alt=''></img>
   </div>

      {/* Card title */}
      <h1 className='text-5xl mb-6 font-extrabold'>Nike Air Max Pre-Day
      </h1>
      {/* suntitle */}
      <div>suntitle</div>

      {/* btn & price wrapper */}
      <div>
        <button>button</button>
        <div>price</div>
          {/* colors */}
          <ul>
            {colors.map((color, index) => {
              return ( 
              <li 
              key={index}
               style={{backgroundColor: color.value}}
              className='w-8 h-8 rounded-full cursor-pointer'>

              </li>
              );
            })}
          </ul>
          {/* card image */}
          <div>
            <img src={NikeImg} alt='' draggable="false"></img>
          </div>
      </div>

      </div>

  </div>;
};

export default Card;
